const Content = (props) => {
  return (
    <div>
      <Part part={props.parts[0].name} ex={props.parts[0].ex}/>
      <Part part={props.parts[1].name} ex={props.parts[1].ex}/>
      <Part part={props.parts[2].name} ex={props.parts[2].ex}/>
    </div>
  )
}

const Total = (props) => {
  return (
    <p>Number of ex {props.parts[0].ex + props.parts[1].ex + props.parts[2].ex}</p>
  )
}

const App = () => {
  const course = {
    name: 'Half Stack application development',
    parts: [
      {
        name: 'Fundamentals of React',
        ex: 10
      },
      {
        name: 'Using props to pass data',
        ex: 7
      },
      {
        name: 'State of a component',
        ex: 14
      }
    ]
  }

  return (
    <div>
      <Header course={course.name} />
      <Content parts={course.parts}/>
      <Total parts={course.parts} />
    </div>
  )
}


export default App
